static void do_debug(void) {
    write(2, "??", 2);
    char c[32] = {0};
    char* cp;
    usize n;
    i64 x; i64 y;
    for (long i = STACK_SIZE-1; i >= (long)stack_counter; i--) {
        cp = c+30;
        x = stack[i].payload.vp_i64;
        n = 1;
        y = x; if (x < 0) { x = -x; }
        do { *cp-- = '0' + (x % 10); x /= 10; n++; } while(x);
        if (y < 0) { *cp-- = '-'; n++; } 
        *cp = ' ';
        write(2, cp, n);
    }
    write(2, "\n", 1);
}

